let arrConfigs = [{
    img: "img-hover__blueOne",
    link: "circle-blue__linkOne",
    modal: ".popup-cheap"
    },
    {
        img: "img-hover__blueTwo",
        link: "circle-blue__linkTwo",
        modal: ".popup-trash"
    },
    {
        img: "img-hover__blueThree",
        link: "circle-blue__linkThree",
        modal: ".popup-longTime"
    },
    {
        img: "img-hover__blueFour",
        link: "circle-blue__linkFour",
        modal: ".popup-faith"
    },
    {
        img: "img-hover__orange",
        link: "circle-orange__linkOne",
        modal: ".popup-fast"
    },
    {
        img: "img-hover__green",
        link: "circle-green__linkOne",
        modal: ".popup-expensive"
    },
    {
        img: "img-hover__greenTwo",
        link: "circle-green__linkTwo",
        modal: ".popup-qualitatively"
    }]

// Open modals
const modalLinks = document.querySelectorAll('.circle__link');
const modalImages = document.querySelectorAll(".img-hover__blur");

modalLinks.forEach(link => {
    link.addEventListener('click', openModalForLink)
})

modalImages.forEach(img => {
    img.addEventListener('click', openModalForLink)
})

function openModalForLink(evt) {
    console.log(evt.target)
    const targetElem = evt.target;
    let domLink = null;
    let mode = ""

    if (targetElem.classList.contains("img-hover__blur")) {
        domLink = targetElem.classList[0]
        mode = 'img'
    } else {
        domLink = targetElem.classList[1];
        console.log(domLink, 'ADWD')
        mode = 'link'
    }

    let findConfig = null;

    if (mode === 'img') {
        findConfig = arrConfigs.find(conf => {
            return conf.img === domLink
        })
    } else {
        findConfig = arrConfigs.find(conf => {
            return conf.link === domLink
        })
    }
    console.log(findConfig, mode)

    document.querySelector(findConfig.modal).classList.add('popup-active')

    console.log(findConfig)
    function close () {
        popup.forEach((popupchik) => {
            if (popupchik.classList.contains('popup-active')) {
                body.classList.add('body-no-scroll')
                popupButton.forEach((spanClose) => {
                    spanClose.addEventListener('click', () => {
                        popupchik.classList.remove('popup-active');
                        body.classList.remove('body-no-scroll')
                    })
                })
                popupClose.forEach((button) => {
                    button.addEventListener('click', () => {
                        popupchik.classList.remove('popup-active');
                        body.classList.remove('body-no-scroll')
                    })
                })
            }
        })

    }
    close()
}